// import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import VehicleChecklist from './pages/VehicleChecklist';

function App() {
  return (
    <Router>
      <div>
        {/* You can include a Navbar component here if you have one */}

        <Switch>
          {/* Other routes can go here */}
          <Route path="/vehiclechecklist" component={VehicleChecklist} />

          {/* Default or 404 route can go last */}
          {/* <Route component={NotFoundPage} /> */}
        </Switch>
      </div>
    </Router>
  );
}


export default App;
